    class Ball{
      constructor(a, b, c, d, prev, now, time) {
        this.prev = prev;
        this.now = now;

        this.a = a;
        this.b = b;
        this.c = c;
        this.d = d;
        this.time =time;
        this.dt=Math.sqrt(a*a+b*b+c*c+d*d-2*(a*c)-2*(b*d))*5;
        this.vx=(c-a)/(this.dt*5);
        this.vy=(d-b)/(this.dt*5);
        this.nx=a;
        this.ny=b;
        this.deg=prev.rotation.x;
        this.deg2=now.rotation.x;
        this.rank=prev.userData.rank;

      }

    function setting(n, callback) {
        var id0;
        var id2;
        if(n==0){
          id0=0
          id2=1
        } else{
          id0=1
          id2=5
        }

        for (let i = id0; i < id2; i++) {
            const game2048 = new Game2048(칸, i);
            if(n==0){
              cubes.push(createBox(0, (i) * bh + bh / 2, 0, bw, bh, bw, game2048, i));
            }else{
              cubes.push(newbox(0, (i) * bh + bh / 2, 0, bw, bh, bw, game2048, i, false));
            }

            cubes[cubes.length - 1].mesh.userData.body = cubes[cubes.length - 1].body;
            cubes[cubes.length - 1].mesh.userData.game2048 = game2048
            cubes[cubes.length - 1].body.sleepState = 0;



            var loc = [];
            for (let row = 0; row < 칸; row++) {
                var temp = [];
                for (let col = 0; col < 칸; col++) {
                    temp.push([-bw / 2 + (tw / 2) + (tw) * (col), 0, -bw / 2 + (tw / 2) + (tw) * (row)])
                }
                loc = [];
            }

        }
        if(n!=0){
          activeFloor = cubes.length;

        }

        if (callback) {
          if(n==0){
            setTimeout(function() {
                callback();
            }, 1000);
          }else{
            callback();
          }


        }
    }

    function colide(body1, body2) {
      for (let i = 0; i < world.contacts.length; i++) {
        const contact = world.contacts[i];
        if ((contact.bi === body1 && contact.bj === body2) || (contact.bi === body2 && contact.bj === body1)) {
          return true;
        }
      }
      return false;
    }

            // ctx.fillRect(0, 1110, 1525, 3157);

            ctx.lineWidth = 1;
            ctx.beginPath();

            ctx.lineTo(wavex, wave.y);
            ctx.lineTo(0, wave.y);
            ctx.lineTo(0, wave.y-(11+65.5)*1);
            var x = 0;
            for (x = 0; x < wavex; x++) {
                var y = wave.y + Math.cos(Math.PI/4+x * wave.length + increment) * wave.amplitude*0.15-(11+65.5)*1;
                ctx.lineTo(x, y);
            }
            ctx.lineTo(wavex, wavey);
            ctx.strokeStyle = "#4790d1";
            ctx.fillStyle = "#1881d7"
            ctx.stroke();
            ctx.fill();


            ctx.lineWidth = 2;
            ctx.beginPath();

            ctx.lineTo(wavex, wave.y);
            ctx.lineTo(0, wave.y);
            ctx.lineTo(0, wave.y-(3+60)*1);
            var x = 0;
            for (x = 0; x < wavex; x++) {
                var y = wave.y + Math.cos(x * 1*wave.length + increment) * wave.amplitude*0.3-(3+60)*1;
                ctx.lineTo(x*1, y);
            }
            ctx.lineTo(wavex, wavey);
            ctx.strokeStyle = "#4790d1";
            ctx.fillStyle = "#1881d7"
            ctx.stroke();
            ctx.fill();



            ctx.lineWidth = 3;
            ctx.beginPath();

            ctx.lineTo(wavex, wave.y+15);
            ctx.lineTo(0, wave.y+15);
            ctx.lineTo(0, wave.y-46*1);
            var x = 0;
            for (x = 0; x < wavex; x++) {
                var y = wave.y + Math.sin(x * 1*wave.length + increment) *0.5*wave.amplitude-46*1;
                ctx.lineTo(x*1, y);
            }

            ctx.lineTo(wavex, wavey);

            ctx.strokeStyle = "#57a0d1";
            ctx.fillStyle = "#0561a7"
            ctx.stroke();
            ctx.fill();




            ctx.lineWidth = 20;
            ctx.beginPath();

            ctx.lineTo(wavex, wavey);
            ctx.lineTo(0, wavey);
            ctx.lineTo(0, wave.y+15);
            var x = 0;
            for (x = 0; x < wavex; x++) {
                var y = wave.y+15 + Math.sin(x * 1*wave.length + increment) *1*wave.amplitude;
                ctx.lineTo(x*1, y);
            }

            ctx.lineTo(wavex, wavey);

            // ctx.strokeStyle = "#87a0d1";
            ctx.fillStyle = "#0042A4"
            ctx.stroke();

    function removeDuplicates(arr) {
        return [...new Set(arr)];

    function findDuplicates(arr) {
        const duplicates = [];
        const seen = new Set();
        arr.forEach((item) => {
            for (const element of item) {
                if (seen.has(element)) {
                    duplicates.push(element);
                } else {
                    seen.add(element);
                }
            }
        })
        return duplicates;
    }

    function getdist(x2, y2, x3, y3) {
        var dstx = Math.abs(x2 - x3);
        var dsty = Math.abs(y2 - y3);
        if (dstx > dsty) {
            return 1.4 * dsty + 1.0 * (dstx - dsty)
        } else {
            return 1.4 * dstx + 1.0 * (dsty - dstx)
        }
    }

    function tohsl(c) {
      const r = c.r
      const g = c.g
      const b = c.b
      const max = Math.max(r, g, b);
      const min = Math.min(r, g, b);
      const diff = max - min;
      let h = 0,
          s = 0,
          l = (max + min) / 2;
      if (diff !== 0) {
          s = l > 0.5 ? diff / (2 - max - min) : diff / (max + min);
          switch (max) {
              case r:
                  h = (g - b) / diff + (g < b ? 6 : 0);
                  break;
              case g:
                  h = (b - r) / diff + 2;
                  break;
              case b:
                  h = (r - g) / diff + 4;
                  break;
          }
          h /= 6;
      }
      // HSL 값을 리턴
      return {
          h: Math.round(h * 360),
          s: Math.round(s * 100),
          l: Math.round(l * 100)
      };

    }

    function hexToHSL(hex0) {
        // hex 값의 RGB 값을 추출
        var hex = hex0.toString();
        const r = parseInt(hex.substring(1, 3), 16) / 255;
        const g = parseInt(hex.substring(3, 5), 16) / 255;
        const b = parseInt(hex.substring(5, 7), 16) / 255;
        // RGB 값으로 HSL 값을 계산
        const max = Math.max(r, g, b);
        const min = Math.min(r, g, b);
        const diff = max - min;
        let h = 0,
            s = 0,
            l = (max + min) / 2;
        if (diff !== 0) {
            s = l > 0.5 ? diff / (2 - max - min) : diff / (max + min);
            switch (max) {
                case r:
                    h = (g - b) / diff + (g < b ? 6 : 0);
                    break;
                case g:
                    h = (b - r) / diff + 2;
                    break;
                case b:
                    h = (r - g) / diff + 4;
                    break;
            }
            h /= 6;
        }
        // HSL 값을 리턴
        return {
            h: Math.round(h * 360),
            s: Math.round(s * 100),
            l: Math.round(l * 100)
        };
    }

    function hslToHex(h, s, l) {
        s /= 100;
        l /= 100;
        let c = (1 - Math.abs(2 * l - 1)) * s;
        let x = c * (1 - Math.abs(((h / 60) % 2) - 1));
        let m = l - c / 2;
        let r = 0;
        let g = 0;
        let b = 0;
        if (0 <= h && h < 60) {
            r = c;
            g = x;
            b = 0;
        } else if (60 <= h && h < 120) {
            r = x;
            g = c;
            b = 0;
        } else if (120 <= h && h < 180) {
            r = 0;
            g = c;
            b = x;
        } else if (180 <= h && h < 240) {
            r = 0;
            g = x;
            b = c;
        } else if (240 <= h && h < 300) {
            r = x;
            g = 0;
            b = c;
        } else if (300 <= h && h < 360) {
            r = c;
            g = 0;
            b = x;
        }
        r = Math.round((r + m) * 255);
        g = Math.round((g + m) * 255);
        b = Math.round((b + m) * 255);
        return "#" + ((1 << 24) + (r << 16) + (g << 8) + b).toString(16).slice(1);
    }

    function hexStringToByteArray(hexString) {
        if (hexString.length % 2 !== 0) {
            throw new Error('16진수 문자열의 길이가 짝수여야 합니다.');
        }
        const byteArray = new Uint8Array(hexString.length / 2);
        for (let i = 0; i < hexString.length; i += 2) {
            const byteValue = parseInt(hexString.substr(i, 2), 16);
            if (isNaN(byteValue)) {
                throw new Error('유효한 16진수 문자열이 아닙니다.');
            }
            byteArray[i / 2] = byteValue;
        }
        return byteArray;
    }

    async function fetchCSV(url) {
        if(true){
          const response = await fetch(url);
          // Ensure the request was successful
          if (response.status !== 200) {
              throw new Error(`Error fetching CSV data: ${response.status}`);
          }
          // Parse the CSV data into a string
          const csvData = await response.text();
          // Split the CSV data into an array of lines
          const dataArray = csvData.trim().split('\n').map(line => line.split(','));
          // The first row contains the labels
          const labels = dataArray.shift();
          // Convert each row into a dictionary object
          const dictionaries = dataArray.map(row => {
              return row.reduce((acc, value, index) => {
                  acc[labels[index]] = value;
                  return acc;
              }, {});
          });
          var dict = {};
          dictionaries.forEach((item) => {
              dict[item["name"]] = item;
          })
          return dict;
        }else{
          loaddb();
          return sdic;

        }
        // Fetch the CSV data from the URL
    }
